import React from 'react';
import './App.css';
import Button from './component/Button'

function App() {
  return (
    <div className="App">
      <div class="nav">
        <h1>Dashboard</h1>
      </div>
      <h2>Liste des entreprises</h2>
      <p>Rechercher une entreprise</p>
      <input type='text'/>
      <button>rechercher</button>
      <Button />
    </div>
  );
}

export default App;
